materials.vertexShader:
attribute vec2 normalizedUV;

varying vec2 vUV;
varying vec2 vUVNormalized;

void main() {
	vUV = uv;

	vUVNormalized = normalizedUV;

	gl_Position = projectionMatrix * modelViewMatrix * vec4( position, 1.0 );
}

materials.fragmentShader:
uniform sampler2D map;
uniform float xOffset;
uniform float yOffset;
uniform float outerStretch;
uniform float width; 
uniform float height; 
uniform float outerCutoff; 
uniform float color; 
uniform vec2 uvStart; 
uniform vec2 uvSize; 
varying vec2 vUV; 
varying vec2 vUVNormalized;

float impulse( float k, float x ) { 
	float h = k*x; 
	return h*exp(1.0 - h);
}


float parabola( float x, float k )
{
    return pow( 4.0*x*(1.0-x), k );
}

void main() {

	vec2 cutoutUV = vUV;
	//cutoutUV.x *= outerStretch;

	cutoutUV.x = uvStart.x + mod(cutoutUV.x + xOffset, uvSize.x);
	cutoutUV.y = uvStart.y + mod(cutoutUV.y - uvStart.y + yOffset, uvSize.y);

	float colAlpha = texture2D(map, cutoutUV).r;//CHANNEL;
	colAlpha *= parabola(vUVNormalized.x, width) + 0.2;

	colAlpha *= impulse(vUVNormalized.y, height) + 0.2;

	if (colAlpha < outerCutoff) {
		discard;
	}

	gl_FragColor = vec4( color, color, color, 0.9 );
}
